import React from 'react';
import './ProcessUnitPage.css';

const DistillationPage = () => (
  <div className="process-unit-page">
    <h1>Distillation Column</h1>
    <img src="https://images.unsplash.com/photo-1464983953574-0892a716854b?auto=format&fit=crop&w=800&q=80" alt="Distillation Column" className="unit-image" />
    <p>
      Distillation columns are used to separate mixtures based on differences in boiling points. They are widely used in the chemical and petrochemical industries.
    </p>
  </div>
);

export default DistillationPage;
